import React, { useEffect, useState } from 'react';
import axios from 'axios';

function Obituary ()
{
    const [data, setData] = useState([])
    
    useEffect( () =>
    {
        axios.get( 'http://localhost:8081/' )
            .then( res => setData(res.data) )
            .catch( err => console.error( err ) );
    }, [] );

  return (
      <div>
          <div>
              <table>
                  <thead>
                    <tr>Thumnail</tr>
                    <tr>Title</tr>
                    <tr>Package</tr>
                    <tr>Status</tr>
                    <tr>Time</tr>
                    <tr>Action</tr>
                  </thead>

                  <tbody>
                      {data.map()}
                  </tbody>
              </table>
          </div>
      </div>
  )
}

export default Obituary
